  backgroundColor: "#525252",
  padding: "10px 20px",
  borderRadius: "5px",
  cursor: "pointer",
  marginRight: "10px",
};

function Home() {
  return (
    <div data-testid="home-component" style={homeStyle}>
      <div style={buttonContainerStyle}>
        {/* Hint: Implement this */}
        <button data-testid="register-button" style={buttonStyle}>
          Register Candidate
        </button>
        <button data-testid="list-button" style={buttonStyle}>
          List Candidates
        </button>
      </div>
    </div>
  );
}

export default Home;
